#import <Foundation/Foundation.h>
#import "MyView.h"

@implementation MyView

-(id)initWithFrame:(CGRect)frame
{
  if (self = [super initWithFrame:frame])
  {
    imageView = [[UIImageView alloc] initWithFrame:CGRectMake(50, 50, 100, 100)];
    [self addSubview:imageView];
    
  }
  return self;
}



-(void)drawRect:(CGRect)rect
{
  CGContextRef cg = UIGraphicsGetCurrentContext();
  CGContextSetStrokeColorWithColor(cg, UIColor.redColor.CGColor);
  CGContextSetLineWidth(cg, 2.0);
  CGContextSetFillColorWithColor(cg, UIColor.cyanColor.CGColor);
  CGContextFillRect(cg, CGRectMake(0, 0, rect.size.width, rect.size.height));
  CGContextStrokeRect(cg, CGRectMake(0, 0, rect.size.width, rect.size.height));
  
  
  // decode JSON
  
  NSString* data = @"{\"DrawChrome\":false,\"IconData\":\"\"}";
  
  NSError* error;
  id temp = [NSJSONSerialization JSONObjectWithData:[data dataUsingEncoding:NSUTF8StringEncoding]
                                              options:0
                                                error:&error];
  
  if(!error && [temp isKindOfClass:[NSDictionary class]])
  {
    if( temp[@"IconData"] )
    {
      NSData* iconData = [[NSData alloc] initWithBase64EncodedString:temp[@"IconData"]
                                                             options:NSDataBase64DecodingIgnoreUnknownCharacters];
      UIImage* img = [UIImage imageWithData:iconData];
      imageView.image = img;
    }
  }
}

@end
